class: FeatureLayer
sources:
  lpimap:
    protocol: arcgis
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: LPIMap
  plan_section_lot:
    protocol: arcgis
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: Plan_Section_Lot
  rfs:
    protocol: arcgis
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: RFS
  hydrography:
    protocol: arcgis
    host: maps.six.nsw.gov.au
    folder: public
    service: NSW_Hydrography
  act-basic:
    protocol: arcgis
    host: data.actmapi.act.gov.au
    folder: actmapi
    service: basic
  act-contours:
    protocol: arcgis
    host: data.actmapi.act.gov.au
    folder: actmapi
    service: contours_2015
  act-water:
    protocol: arcgis
    host: data.actmapi.act.gov.au
    folder: data_extract
    service: Water
  poi:
    protocol: arcgis
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: POI
  raster-labels:
    protocol: arcgis
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: LPI_RasterLabels_1
features:
  plantation:
    name: Building_Large
    where:
    - classsubtype = 6
    - generalculturaltype = 1
  urban-areas: Urban
  contours:
  - source: act-contours
    name: 2015 Contours - 5m
    where: FLOOR(Contour / 25) * 25 < Contour
    category: Standard
  - source: act-contours
    name: 2015 Contours - 5m
    where: FLOOR(Contour / 25) * 25 = Contour
    label: Contour
    category: Standard
  - source: act-contours
    name: 2015 Contours - 10m
    where: FLOOR(Contour / 50) * 50 < Contour
    category: Standard
  - source: act-contours
    name: 2015 Contours - 10m
    where: FLOOR(Contour / 50) * 50 = Contour
    label: Contour
    category: Index
  cadastre:
  - source: plan_section_lot
    name: Lot
    where: classsubtype = 1
  - source: act-basic
    name: Urban Registered
  - source: act-basic
    name: Rural Registered
  watercourses:
    source: hydrography
    name: Hydroline
    where:
    - classsubtype = 1
    - hydrotype NOT IN (5, 6)
    category:
    - relevance
    - hydrotype
  watercourse-labels:
    source: lpimap
    name: Stream_Names
    category: relevance
    label: hydronamestring
  stock-dams:
    name: StockDams
    category: hydrotype
  water-areas:
    source: act-water
    name: ACT Water Features polygon
    category: WATER_BODY_TYPE
    where: WATER_BODY_TYPE NOT IN ('SWAMP')
  railway-tunnels:
    name: Railway_intunnel_LS
    where: operationalstatus NOT IN (3,8)
    category: classsubtype
  floodways:
    source: rfs
    name: RoadSegment
    where:
    - operationalstatus NOT IN (3,8)
    - roadontype = 4
    - classsubtype <> 8
    - functionhierarchy IN (1,2,3,4,5,6)
    category: functionhierarchy
  roads:
  - source: rfs
    name: RoadSegment
    where:
    - operationalstatus NOT IN (3,8)
    - roadontype <> 3
    - classsubtype <> 8
    - roadnamebase IS NULL OR roadnamebase <> 'QUARRY'
    category:
    - surface
    - classsubtype
    - functionhierarchy
    - roadontype
  - source: rfs
    name: RoadSegment
    where: roadnamebase = 'QUARRY'
    category:
    - UnsealedSurface
    - StandardRoad
    - LocalRoad
    - OnGround
  road-labels:
    source: raster-labels
    name: Raster_Road_Labels
    where:
    - operationalstatus NOT IN (3,8)
    - functionhierarchy NOT IN (7,10,11)
    - functionhierarchy NOT IN (6) OR relevance < 6
    - roadnamestring NOT LIKE '%BICENTENNIAL NATIONAL%'
    - roadnamestring NOT LIKE '%AUSTRALIAN ALPS%'
    - roadnameoid IS NOT NULL
    category:
      functionhierarchy:
        1: Motorway
        2: PrimaryRoad
        3: ArterialRoad
        4: SubArterialRoad
        5: DistributorRoad
        6: LocalRoad
        7: UrbanServiceLane
        8: Track
        9: Path
        10: DedicatedBusWay
        11: AccessWay
    label: roadnamestring
  railways:
    name: Railway_onground_LS
    where: operationalstatus NOT IN (3,8)
    category:
    - classsubtype
    - railontype
  road-bridges:
    source: rfs
    name: RoadSegment
    where:
    - operationalstatus NOT IN (3,8)
    - roadontype = 2
    - classsubtype <> 8
    category:
    - functionhierarchy
    - classsubtype
    - surface
  railway-bridges:
    name: Railway_onbridge_LS
    where:
    - operationalstatus NOT IN (3,8)
    - railontype = 2
    category: classsubtype
  tanks:
    source: rfs
    name: TankPoint
  buildings:
  - name: Dwellings_Buildings
    category: small
  - name: Building_Large
    where: classsubtype = 5
    category: large
  - source: poi
    name: Points Of Interest
    where:
    - poigroup = 1
    - poitype = 'Homestead' OR (poitype = 'Community Facility' AND poiname LIKE '% HUT')
    category: poitype
    label-only: true
    label: poiname
  towers:
    name: Beacon_Tower
    where: classsubtype = 7
  yards-quarries-windmills:
    name: Beacon_Tower
    where:
    - classsubtype = 4
    - generalculturaltype IN (8,9,11,12)
    category: generalculturaltype
  state-border:
    source: act-basic
    name: ACT Border
  feature-labels:
  - source: poi
    name: Points Of Interest
    where: poitype IN ('Gap / Pass / Saddle','Headland','Mountain/Hill/Peak','Peninsula / Spit','Plateau / Tableland','Island','Rapids','Sandbar / Shoal','Lock')
    category: poitype
    label: poiname
  - name: Ridge_Beach
    where: generalname <> 'GREAT DIVIDING RANGE'
    category: fuzzylinefeaturetype
    label: generalname

relief-masks:
- water-areas

